import React, { useState, useEffect } from 'react';
import Title from '../Title/title.js';
import ENDPOINTS from '../constants/routes.js';
import ButtonLink from './buttons/buttonLink.js';

const HomePage = () => {
  return (<>
  <Title nameP="world" />
  <ButtonLink route = {ENDPOINTS.QUESTION_URL}>To questions mode</ButtonLink>
  </>)
}

export default HomePage
